import React from 'react';
import {View, Text, StyleSheet} from 'react-native';
const ListItem = (props) => {
    return (
        <View style={styles.listItem} onPress={props.onItemPressed}>
            <Text>
                {props.placeName}
            </Text>
        </View>
    );
};

const styles = StyleSheet.create({
    listItem: {
        width: '100%',
        padding: '10',
        backgroundColor:'#eee',
        margin:5
    }
})

export default ListItem;
